# Steps to reproduce the problem
1. Serve an HTML file with an error / unhandledrejection handler

```html
<html>
  <head>
    <script>
      const addEventListenerHandler = (event) => {
        const error = event && (event.error || event.reason);
        console.log('addEventListenerHandler', event);
      };

      window.addEventListener('error', addEventListenerHandler);
      window.addEventListener('unhandledrejection', addEventListenerHandler);

      async function NetworkError() {
        try {
          // TODO - replace with URL that returns invalid JSON
          const response = await fetch('http://localhost:5001/');
          console.log(response.status);
          console.log(await response.json())
        } catch (e) {
          throw e;
        }
      }
    </script>  
  </head>
  <body>
    <p><button onclick="NetworkError()">Network Error</button></p>
  </body>
</html>
````

2. Update code to cause network error

# Problem Description
The error should be reported to the window error listeners, but it is not.

This code works in other browser and correctly reports the error in the window error / unhandledrejection handlers.

# Additional Comments
Also affects Microsoft Edge, I assume because they use Chromium.

# Summary
fetch Response.json() errors are not reported to window.error or unhandledrejection listeners

